import {
  HomeIcon,
  UploadIcon,
  HeaderIcon,
  ServersIcon,
  ExportsIcon,
  TagsIcon,
  EditIconOutlined,
} from "../../assets/icons";

export const sidebarMenu = [
  {
    path: "/Home",
    title: "Home",
    icon: HomeIcon,
    id: "home",
  },
  {
    path: "/api-doc-gen/upload",
    title: "Upload",
    icon: UploadIcon,
    id: "upload",
  },
  {
    path: "/api-doc-gen/header",
    title: "Header",
    icon: HeaderIcon,
    id: "header",
  },
  {
    path: "/api-doc-gen/servers",
    title: "Servers",
    icon: ServersIcon,
    id: "servers",
  },
  {
    path: "/api-doc-gen/tags",
    title: "Tags",
    icon: TagsIcon,
    id: "tags",
  },
  {
    path: "/Main",
    title: "Main",
    icon: EditIconOutlined,
    id: "main",
  },
  {
    path: "/Schemas",
    title: "Schemas",
    icon: EditIconOutlined,
    id: "schemas",
  },
  {
    path: "/Exports",
    title: "Exports",
    icon: ExportsIcon,
    id: "exports",
  },
  {
    path: "/test-wizard/test-builder",
    title: "API Validator",
    icon: HeaderIcon,
    id: "apiValidator",
  },
  {
    path: "/test-wizard/test-executer",
    title: "API Validator",
    icon: HeaderIcon,
    id: "apiValidator",
  },
];
